import { ADD_FILTERM, REMOVE_FILTER, CLEAR_FILTER } from "./filter-action";

export const filterReduser = (state = [], action) => {
  switch (action.type) {
    case CLEAR_FILTER: {
      return [];
    }

    default: {
      return state;
    }
  }
};
